// Handle theme synchronization
const html = document.documentElement;
const forcedTheme = html.getAttribute("data-forced-theme");
const currentTheme = html.getAttribute("data-theme");

if (forcedTheme) {
  // If forced theme exists, sync it to data-theme
  html.setAttribute("data-theme", forcedTheme);
} else if (!currentTheme) {
  // If no theme is set at all, default to company
  html.setAttribute("data-theme", "company");
}
// If data-theme is already set (from server), leave it as is

(function(){const plausibleDomain = "nutrient.io";
const plausibleScript = "https://pa.nutrient.io/js/script.js";

      (function () {
        function hasTeamCookie() {
          return document.cookie.split(";").some(function (c) {
            return c.trim().startsWith("nutrient_team=true");
          });
        }
        if (hasTeamCookie()) {
          console.log("[Plausible] External script not loaded for team member");
          return;
        }
        const s = document.createElement("script");
        s.defer = true;
        s.setAttribute("data-domain", plausibleDomain);
        s.src = plausibleScript;
        document.head.appendChild(s);
      })();
    })();

// Skip tracking if team member cookie is set
function hasTeamCookie() {
  return document.cookie.split(';').some(function(c) {
    return c.trim().startsWith('nutrient_team=true');
  });
}
if (hasTeamCookie()) {
  console.log('[Plausible] Tracking disabled for team member');
} else {

window.plausible =
  window.plausible ||
  function (...args) {
    (window.plausible.q = window.plausible.q || []).push(args);
  };

document.addEventListener("DOMContentLoaded", function () {
  // Configuration for click tracking
  // Each entry maps a selector to an event configuration
  const clickTrackers = [
    // Copy buttons tracking
    {
      selector: "div.copy",
      eventName: "Copy Code",
      gtmEvent: "click_copy",
      idAttribute: "copy-click"
    },
    // CTA Buttons
    {
      selector: "#main-nav-contact-sales-cta",
      eventName: "Click Contact Sales CTA",
      gtmEvent: "click_contact_sales_cta",
      idAttribute: "main-nav-contact-sales-cta"
    },
    {
      selector: "#main-nav-trial-cta",
      eventName: "Click Trial CTA",
      gtmEvent: "click_trial_cta",
      idAttribute: "main-nav-trial-cta"
    },
    {
      selector: "#main-nav-downloads-cta",
      eventName: "Click Downloads CTA",
      gtmEvent: "click_downloads_cta",
      idAttribute: "main-nav-downloads-cta"
    },
    {
      selector: "#copy-page-cta",
      eventName: "Click Copy Page CTA",
      gtmEvent: "click_copy_page_cta",
      idAttribute: "copy-page-cta"
    },
    {
      selector: "#view-markdown-cta",
      eventName: "Click View Markdown CTA",
      gtmEvent: "click_view_markdown_cta",
      idAttribute: "view-markdown-cta"
    },
    // AI Chat CTAs
    {
      selector: "#open-chatgpt-cta",
      eventName: "Click Open with ChatGPT CTA",
      gtmEvent: "click_open_chatgpt_cta",
      idAttribute: "open-chatgpt-cta"
    },
    {
      selector: "#open-claude-cta",
      eventName: "Click Open with Claude CTA",
      gtmEvent: "click_open_claude_cta",
      idAttribute: "open-claude-cta"
    },
    {
      selector: "#open-grok-cta",
      eventName: "Click Open with Grok CTA",
      gtmEvent: "click_open_grok_cta",
      idAttribute: "open-grok-cta"
    }
  ];

  // Generic function to attach click tracking to an element
  function attachClickTracking(element, config) {
    // Avoid adding multiple listeners
    if (element.hasAttribute("data-plausible-tracked")) return;

    element.setAttribute("data-plausible-tracked", "true");

    // Set ID if provided in config
    if (config.idAttribute && !element.id) {
      element.setAttribute("id", config.idAttribute);
    }

    element.addEventListener("click", function () {
      const elementId = element.id || config.idAttribute || "unknown";

      // Track with Plausible
      if (window.plausible) {
        window.plausible(config.eventName, {
          props: {
            location: window.location.pathname,
            referrer: document.referrer,
            element_id: elementId
          },
        });
      }

      // Send to GTM reliably via dataLayer
      if (window.dataLayer) {
        window.dataLayer.push({
          event: config.gtmEvent,
          click_id: elementId,
          location: window.location.pathname,
          referrer: document.referrer
        });
      }
    });
  }

  // Function to process existing and new elements
  function processElements() {
    clickTrackers.forEach(function(config) {
      const elements = document.querySelectorAll(config.selector);
      elements.forEach(function(element) {
        attachClickTracking(element, config);
      });
    });
  }

  // Use MutationObserver to handle dynamically added elements
  const observer = new MutationObserver(function (mutations) {
    mutations.forEach(function (mutation) {
      mutation.addedNodes.forEach(function (node) {
        if (node.nodeType === 1) {
          // Element node - check all configured selectors
          clickTrackers.forEach(function(config) {
            // Check if the node itself matches
            if (node.matches && node.matches(config.selector)) {
              attachClickTracking(node, config);
            }
            // Check for matching elements within the added node
            if (node.querySelectorAll) {
              const matchingElements = node.querySelectorAll(config.selector);
              matchingElements.forEach(function(element) {
                attachClickTracking(element, config);
              });
            }
          });
        }
      });
    });
  });

  // Track existing elements
  processElements();

  // Start observing for new elements
  observer.observe(document.body, {
    childList: true,
    subtree: true,
  });
});
} // end hasTeamCookie else block

(function(){const platformSlug = "";
const platformMap = {"web":"Web","document-authoring":"Document Authoring","ios":"iOS","android":"Android","mac-catalyst":"Mac Catalyst","document-engine":"Document Engine","dws-processor":"DWS Processor","dws-viewer":"DWS Viewer","ai-assistant":"AI Assistant","ai-document-processing":"AI Document Processing","dotnet":".NET","java":"Java","nodejs":"Node.js","visionos":"VR and Spatial","document-converter":"Document Converter","document-editor":"Document Editor","document-searchability":"Document Searchability","document-automation-server":"Document Automation Server","workflow-automation":"Workflow Automation","react-native":"React Native","flutter":"Flutter","electron":"Electron","maui":"MAUI","dotnet-for-ios":".NET for iOS","dotnet-for-android":".NET for Android","cordova":"Cordova","ionic":"Ionic","processor":"Processor","server":"Web Server-Backed","uwp":"UWP","xamarin-ios":"Xamarin.iOS","xamarin-android":"Xamarin.Android","salesforce":"Salesforce","sharepoint":"SharePoint","teams":"Microsoft Teams","onedrive":"OneDrive"};
const currentUrl = "/404/";

  // Generate schema once DOM is ready
  function generateCodeSamplesSchema() {
    // Get runtime platform from URL path
    const runtimePlatform = platformMap[platformSlug] || null;

    // Find all code blocks
    const preElements = document.querySelectorAll("pre[data-language]");
    if (preElements.length === 0) return;

    const codeSamples = [];

    preElements.forEach((preElement) => {
      const language = preElement.getAttribute("data-language") || "text";
      const codeElement = preElement.querySelector("code");
      if (!codeElement) return;

      // Check if this code block is inside a selector component
      // Traverse up to find parent with data-selector-content attribute
      let selectorPlatform = null;
      let selectorKeyForFallback = null;
      let currentParent = preElement.parentElement;
      while (currentParent && currentParent !== document.body) {
        const selectorKey = currentParent.getAttribute("data-selector-content");
        if (selectorKey) {
          selectorKeyForFallback = selectorKey;
          // Extract platform from selector key
          // Selector keys can be: "web-vanilla-js", "mobile-ios", "server-document-engine", etc.
          // Try to find the longest matching platform slug from the key
          // This handles multi-part platform slugs like "document-engine", "react-native", etc.

          const keyParts = selectorKey.split("-");

          // Try matching platform slugs of different lengths (from longest to shortest)
          // e.g., for "server-document-engine", try "document-engine" before "document"
          for (let len = keyParts.length; len > 0; len--) {
            for (let start = 0; start <= keyParts.length - len; start++) {
              const candidate = keyParts.slice(start, start + len).join("-");
              if (platformMap[candidate]) {
                selectorPlatform = platformMap[candidate];
                break;
              }
            }
            if (selectorPlatform) break;
          }
          break;
        }
        currentParent = currentParent.parentElement;
      }

      // Determine the effective runtime platform
      // Priority: 1) Mapped platform from selector, 2) URL path platform, 3) Selector key as fallback
      let effectiveRuntimePlatform = selectorPlatform || runtimePlatform;

      // If no platform found but we have a selector key, use a formatted version of the key
      // This handles cases like "xamarin", "windows", "api" that aren't in the platform map
      if (!effectiveRuntimePlatform && selectorKeyForFallback) {
        // Extract the most relevant part (usually the first or second segment)
        const keyParts = selectorKeyForFallback.split("-");
        // Skip common category prefixes like "mobile", "server", "desktop", "cloud", "api"
        const categoryPrefixes = [
          "mobile",
          "server",
          "desktop",
          "cloud",
          "api",
        ];
        let relevantPart = keyParts[0];

        if (categoryPrefixes.includes(keyParts[0]) && keyParts.length > 1) {
          relevantPart = keyParts[1];
        }

        // Capitalize first letter for consistency
        effectiveRuntimePlatform =
          relevantPart.charAt(0).toUpperCase() + relevantPart.slice(1);
      }

      // Extract code text, excluding line numbers
      let codeText = "";

      // Check if this is Expressive Code with line numbers
      const lines = codeElement.querySelectorAll(".ec-line");
      if (lines.length > 0) {
        // Expressive Code structure - extract text from each line, excluding line numbers
        const codeLines = [];
        lines.forEach((line) => {
          // Get the content div which contains the actual code (not line numbers)
          const content = line.querySelector(".code");
          if (content) {
            const lineText = content.textContent || "";
            // Only add non-empty lines to preserve actual blank lines in code
            codeLines.push(lineText);
          } else {
            // Fallback: get all text but try to remove line number spans
            const lineNumber = line.querySelector(".line");
            if (lineNumber) {
              // Clone the line and remove the line number element
              const clone = line.cloneNode(true);
              const clonedLineNumber = clone.querySelector(".line");
              if (clonedLineNumber) {
                clonedLineNumber.remove();
              }
              codeLines.push(clone.textContent || "");
            } else {
              codeLines.push(line.textContent || "");
            }
          }
        });
        // Join lines and clean up excessive blank lines (more than 1 consecutive)
        codeText = codeLines.join("\n").replace(/\n{3,}/g, "\n\n");
      } else {
        // Standard code block without line numbers
        codeText = codeElement.textContent || "";
      }

      if (codeText.length === 0 || codeText.length > 5000) return;

      // Find nearest heading before this code block
      let context = "";
      let currentElement = preElement.previousElementSibling;

      for (let i = 0; i < 5 && currentElement; i++) {
        if (currentElement instanceof HTMLElement) {
          const tagName = currentElement.tagName.toLowerCase();
          if (["h1", "h2", "h3", "h4", "h5", "h6"].includes(tagName)) {
            context = currentElement.textContent || "";
            break;
          }
        }
        currentElement = currentElement.previousElementSibling;
      }

      // Create name and description
      let name = "";
      if (context) {
        name = context.trim();
        if (name.length > 100) {
          name = name.substring(0, 97) + "...";
        }
      } else {
        const nameParts = ["Code example"];
        if (effectiveRuntimePlatform) {
          nameParts.push("for", effectiveRuntimePlatform);
        }
        nameParts.push("in", language);
        name = nameParts.join(" ");
      }

      // Build schema object
      const sampleSchema = {
        "@type": "SoftwareSourceCode",
        name: name,
        description: name,
        programmingLanguage: language,
        codeSampleType: "inline",
        text: codeText.trim(),
        isPartOf: {
          "@type": "WebPage",
          "@id": window.location.origin + currentUrl,
        },
      };

      if (effectiveRuntimePlatform) {
        sampleSchema.runtimePlatform = effectiveRuntimePlatform;
      }

      codeSamples.push(sampleSchema);
    });

    // Update schema if we found code samples
    if (codeSamples.length > 0) {
      const schemaScript = document.getElementById("code-samples-schema");
      if (schemaScript) {
        const schema = {
          "@context": "https://schema.org",
          "@graph": codeSamples,
        };
        // Stringify and escape HTML-sensitive characters to prevent breaking the script tag
        let jsonString = JSON.stringify(schema, null, 2);
        // Escape angle brackets to prevent script tag issues in code samples
        const ltChar = String.fromCharCode(60); // '<'
        const gtChar = String.fromCharCode(62); // '>'
        const escapedLt = "\\u003c";
        const escapedGt = "\\u003e";
        jsonString = jsonString
          .split(ltChar)
          .join(escapedLt)
          .split(gtChar)
          .join(escapedGt);
        schemaScript.textContent = jsonString;
      }
    }
  }

  // Run immediately if DOM is already loaded (production SSG)
  if (document.readyState === "loading") {
    // Still loading, wait for DOMContentLoaded
    document.addEventListener("DOMContentLoaded", generateCodeSamplesSchema);
  } else {
    // DOM already loaded (common in dev mode or if script is deferred)
    generateCodeSamplesSchema();
  }

  // Also run on Astro page navigation for SPA-like transitions
  document.addEventListener("astro:page-load", generateCodeSamplesSchema);
})();

header.script:
(function(){const lobType = "nutrient";

  /* global lobType */
  const lob = lobType;

  document.addEventListener("DOMContentLoaded", () => {
    const activeNavItem = document.getElementById(`tnb-${lob}`);

    if (activeNavItem) {
      // add is-active to nav-card
      activeNavItem.classList.add("is-active");

      // add is-active to nav-card-bottom
      const navCardBottom = activeNavItem.querySelector(".nav-card-bottom");
      navCardBottom?.classList.add("is-active");
    }
  });
})();
